import React from 'react';
import ToDoListItem from './ToDoListItem';

const ToDoList = ( {todoData} ) =>{

    const items = todoData.map((item,index) => {
        return(
        <li><ToDoListItem 
            label = { item.label }
            important = { item.important }
            />
        </li>
        );
    });

    return(
      <ul>
          {items}
      </ul>
    );
  };

  export default ToDoList;
